    'Lesson 4. Alterations',
    'lesson 5. Introduction',
    'Lesson 6. Musical notation p.1',
    'Lesson 7. Musical notation p.2',
    'Lesson 8. Alterations',
    'lesson 9. Introduction',
    'Lesson 10. Musical notation p.1',
    'Lesson 11. Musical notation p.2',
    'Lesson 12. Alterations',
]

export function Lessons() {

    return (
        <>
        lessons.map((lesson) => {
            <div className='lesson'>{lesson}</div>
